module.exports = (config, arc) => {

	let hasAddedPageBuilder = false;
	let hasAddedLangLabels = false;

	if (!config.adminUi) {
		return {
			'landingPage': [{items: [config.treeModel]}],
			'theme': defaultTheme
		}
	}

	let returnObj = {
		'landingPage': config.adminUi.landingPage || [{items:[config.treeModel]}],
		'theme':  config.adminUi.theme || defaultTheme
	}

	returnObj.landingPage = returnObj.landingPage.map((row, index) => {

		row.items = row.items.map(item => {

			// if an href property is present, then we know to look up models
			if (!item.href) {
			
				const modelData = arc.getModels(item.listName || item);
				
				if (!modelData) return {};

				const type = (modelData.listName === config.treeModel) ? 'builder' : item.type || modelData.type;

				if (config.lang && config.lang.config && modelData.listName === config.lang.config.globalLabelsListName) {
					hasAddedLangLabels = true
				}
				
				if (modelData.listName === config.treeModel) hasAddedPageBuilder = true;

				return {
					listName: modelData.listName,
					label: item.label || modelData.arcLabel || modelData.label,
					svg: svgify(item.svg || modelData.svg || defaultSvg(type), returnObj.theme.primaryColor),
					description: item.descroption || modelData.description,
					hidden: item.hidden || modelData.arcHidden,
					type: type
				}

			} else {

				return {
					listName: item.listName,
					label: item.label,
					href: item.href,
					svg: svgify(item.svg || defaultSvg(item.type), returnObj.theme.primaryColor),
					description: item.description,
					target: item.target || '_blank',
					hidden: item.hidden,
					type: item.type
				}
			}	 

		});

		return row;

	});

	// if we are using multilang features and
	// if we have not included the translated labels 
	// we need to force add it to the ver beginning. 
	if (config.lang && config.lang.config && !hasAddedLangLabels) {
		
		const modelData = arc.getModels(config.lang.config.globalLabelsListName);
console.log(modelData.listName);
		returnObj.landingPage[0].items.unshift({
			listName: modelData.listName,
			label: modelData.arcLabel || modelData.label,
			svg: svgify(modelData.svg || defaultSvg('translation-label'), returnObj.theme.primaryColor),
			description: modelData.description,
			hidden: modelData.arcHidden,
			type: 'translation-label'
		});
	}


	// if we have not included the pagebuilder link 
	// we need to force add it to the ver beginning.  
	if (!hasAddedPageBuilder) {
		
		const modelData = arc.getModels(config.treeModel);

		returnObj.landingPage[0].items.unshift({
			listName: modelData.listName,
			label: modelData.arcLabel || modelData.label,
			svg: svgify(modelData.svg || defaultSvg('builder'), returnObj.theme.primaryColor),
			description: modelData.description,
			hidden: modelData.arcHidden,
			type: 'builder'
		});

	}

	return returnObj;

};
